export default function PlayerDetails(props) {
  return (
    <>
      <div>
        <img src={props.song.img_src} alt="" />
      </div>
      <h3 className="details-title">{props.song.title}</h3>
      <h3 className="details-title">{props.song.artist}</h3>
    </>
  )
}
